import "./SearchResult.css";
import Products from "./Products";

export const SearchResult = ({ result }) => {

  const addProduct = (product) => {
    dispatch(addCart(product))
  }

  return (
    <div
      className="search-result"
      onClick={() => addProduct(product)}
    >
    <Products />
      {result}
    </div>
  );
};
